import React from "react";
import './Style.css';

function Nav_bar() {
    return (
        <nav class="navbar navbar-dark bg-dark fixed-top">
            <div class="mx-auto">
                <text class="navbar-brand mx-auto">Engineer Firmware Update</text>
            </div>
        </nav>
    );
}

export default Nav_bar;
